de:
33. AUSGABE DES CAPBRETON JAZZ FESTIVALS
Das Jazzfestival von Capbreton findet wieder in unserer Seestadt statt und hat es sich dieses Jahr vom 1. bis 9. Juli gemütlich gemacht. Eine ganze Woche steht im Zeichen der blauen Note. Inmitten der Weinberge und an den idyllischen Ufern des Boudigau bietet Ihnen die Stadt Capbreton ein breites Spektrum an kostenlosen Konzerten und Veranstaltungen für Jazzliebhaber und Neugierige auf der Suche nach Geselligkeit. Der Jardin public spielt mit seinem Village, dem Herzstück des Festivals, wieder eine zentrale Rolle. Die Mediathek und Ludothek L'Écume des jours bietet einen CD-Verkauf, einen Hörraum und Riesenspiele für Groß und Klein;
der Plattenladen La Sound Factory schließt sich dem Abenteuer an, um diese grüne Oase in einen Ort der musikalischen Entdeckungen zu verwandeln.

en:
33RD EDITION OF THE CAPBRETON JAZZ FESTIVAL
The Capbreton Jazz Festival is back in our seaside town and will be held this year from July 1st to 9th. A whole week under the sign of the blue note. In the heart of the vineyards and on the bucolic banks of the Boudigau, the town of Capbreton offers a wide range of free concerts and activities for jazz enthusiasts and the curious in search of conviviality. The Public Garden finds its central role with its Village, true beating heart of the festival. The Circus welcomes you to its refreshment bar and programs the aperitif-blues at the beginning of the evening; the media and games library L?Écume des jours offers a CD sale, a listening area and giant games for young and old;
the record shop La Sound Factory joins the adventure to make this green setting a place of musical discoveries.

it:
33ª EDIZIONE DEL FESTIVAL JAZZ DI CAPBRETON
Il Capbreton Jazz Festival torna nella nostra città di mare, quest'anno dal 1° al 9 luglio. Un'intera settimana all'insegna della nota blu. Nel cuore dei vigneti e sulle bucoliche rive del Boudigau, la città di Capbreton offre un'ampia gamma di concerti e attività gratuite per gli amanti del jazz e per chi è alla ricerca di convivialità. Il Giardino Pubblico giocherà ancora una volta un ruolo centrale con il suo Villaggio, vero cuore pulsante del festival. Il Circus vi accoglie nel suo punto di ristoro e organizza l'aperitivo blues di inizio serata; la mediateca e ludoteca L'Écume des jours propone una vendita di CD, un'area di ascolto e giochi giganti per grandi e piccini;
il negozio di dischi La Sound Factory si unisce all'avventura per fare di questa cornice verde un luogo di scoperta musicale.

fr:
33E ÉDITION DU CAPBRETON JAZZ FESTIVAL
Le festival de jazz de Capbreton reprend ses quartiers dans notre cité marine en s’installant confortablement cette année du 1er au 9 juillet. Une semaine entière sous le signe de la note bleue. Au coeur des vignes puis sur les berges bucoliques du Boudigau, la Ville de Capbreton vous offre un large éventail de concerts gratuits et d’animations pour les passionnés de jazz et les curieux en quête de convivialité. Le Jardin public retrouve son rôle central avec son Village, véritable coeur battant du festival. Le Circus vous accueille à sa buvette et programme les apéro-blues de début de soirée ; la médiathèque-ludothèque L’Écume des jours propose une braderie de CD, un espace d’écoute et des jeux géants pour petits et grands ;
le disquaire La Sound Factory rejoint l’aventure pour faire de cet écrin de verdure un lieu de découvertes musicales.

es:
33ª EDICIÓN DEL FESTIVAL DE JAZZ DE CAPBRETON
El Festival de Jazz de Capbreton vuelve a nuestra ciudad costera, este año del 1 al 9 de julio. Toda una semana bajo el signo de la nota azul. En el corazón de los viñedos y en las bucólicas orillas del Boudigau, la ciudad de Capbreton ofrece un amplio abanico de conciertos y actividades gratuitas para los aficionados al jazz y los curiosos en busca de convivencia. El Jardín Público volverá a desempeñar un papel central con su Village, auténtico corazón palpitante del festival. El Circus le da la bienvenida en su puesto de refrescos y organiza el aperitivo blues a primera hora de la tarde; la mediateca y ludoteca L'Écume des jours ofrece una venta de CD, un espacio de escucha y juegos gigantes para grandes y pequeños;
la tienda de discos La Sound Factory se une a la aventura para hacer de este espacio verde un lugar de descubrimiento musical.

nl:
33E EDITIE VAN HET JAZZFESTIVAL VAN CAPBRETON
Het Capbreton Jazz Festival is terug in onze badplaats, dit jaar van 1 tot 9 juli. Een hele week in het teken van de blauwe noot. In het hart van de wijngaarden en aan de bucolische oevers van de Boudigau biedt de stad Capbreton een breed scala aan gratis concerten en activiteiten voor jazzliefhebbers en nieuwsgierigen op zoek naar gezelligheid. De Publieke Tuin zal opnieuw een centrale rol spelen met zijn Village, het echte kloppende hart van het festival. Het Circus ontvangt u in zijn drankstand en organiseert de aperitiefblues aan het begin van de avond; de media- en spelotheek L'Écume des jours biedt een cd-verkoop, een luisterruimte en reuzenspelen voor jong en oud;
de platenwinkel La Sound Factory sluit zich aan bij het avontuur om van dit groene kader een plaats van muzikale ontdekking te maken.
